import { Component } from '@angular/core';
import { ClientesService } from '../../../../../servicios/clientServices';
import { zip } from 'rxjs';

@Component({
  selector: 'app-show-cliente',
  templateUrl: './show-cliente.component.html',
  styleUrls: ['./show-cliente.component.css']
})
export class ShowClienteComponent {
  clientes:Cliente[] = [ ];
  clienteName:any = "";
  clientePrice:any = "";
  constructor(private clienteService:ClientesService){}

    ngOnInit(): void {

      zip(this.clienteService.castCliente, this.clienteService.castPrice)
        .subscribe(([clienteName, clientePrice]) => {
          const cliente = { name: clienteName, price: clientePrice };
          this.clientes.push(cliente);
        });


      this.clienteService.sendClientes(this.clienteName, this.clientePrice, this.clientePrice).subscribe((clientes:Cliente[]) => {
          this.clientes = clientes;
        }   
    );
  }
}
export interface Cliente {name: string; 
                          price: string; }
